import React from "react";
import "./Register.css"

const Register = () => {
  return (
    <div className="sign">
      <div className="signWrapper">
        <div className="signLeft">
          <h3 className="signLogo">Real SNS</h3>
          <span className="signDesc">本格的なSNSです</span>
        </div>
        <div className="signRight">
          <div className="signBox">
            <p className="signMsg">新規登録</p>
            <input type="text" className="signInput" placeholder="ユーザー名" />
            <input type="text" className="signInput" placeholder="Eメール" />
            <input type="text" className="signInput" placeholder="パスワード" />
            <input type="text" className="signInput" placeholder="確認用パスワード" />
            <button className="signButton">サインアップ</button>
            <button className="signRegisterButton">ログイン</button>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Register;
